import React, { useState } from 'react'
import axios from 'axios'

//



export default function Course({course_id}) {
    const [data, setData] = useState([])


    axios.get('http://localhost:5000/course/BIO-101')
    .then(res => {
        console.log(res.data)
        setData(res.data)
    })
    .catch(err => {
        console.log(err)
    })

    return (
        <div className="course">
            <h1>Course</h1>
            <ul>
                {data.map((item, index) => {
                    return (
                        // each item as a button

                        <li>
                            {item.course_id}
                            <a href={"/course/" + course_id}>
                                {item.course_id}
                            </a>
                        </li>

                    )
                }
                )}
            </ul>
        </div>
    )


}
